import { useEffect } from 'react';

function RecipeList() {
  useEffect(() => {
    fetch('http://localhost:3000/recipes', {
      headers: { 'Access-Control-Allow-Origin': 'http://localhost:3001/' },
    })
      .then((res) => res.json())
      .then((data) => console.log(data));
  }, []);
  return;
}

export default RecipeList;
